VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Alcohol Use Disorder (AUD) Also called: Alcohol Abuse, Alcohol dependence, Alcoholism On this page Basics Summary Start Here Symptoms Diagnosis and Tests Prevention and Risk Factors Treatments and Therapies Learn More Living With Related Issues Genetics See, Play and Learn Health Check Tools Research Statistics and Research Clinical Trials Journal Articles Resources Find an Expert For You Teenagers Older Adults Patient Handouts Summary What is alcohol use disorder (AUD)? For most adults, moderate alcohol use is probably not harmful. Your risk of developing an alcohol use disorder (AUD) depends on how much, how often, and how quickly you drink alcohol. Alcohol misuse means that drinking causes distress and harm. Over time alcohol misuse can increase your risk of AUD. AUD can range from mild to severe, depending on the symptoms. Severe AUD is sometimes called alcoholism or alcohol dependence.', '{-0.10724790394306183,-0.39333242177963257,-0.7101711630821228,-0.03808769956231117,0.3282236158847809,0.4013330042362213,-0.1323891431093216,0.23055808246135712,-0.15197984874248505,-0.29140061140060425,0.42679738998413086,-0.16278965771198273,0.025037415325641632,-0.6334163546562195,-0.23715507984161377,0.2128044068813324,-0.042435724288225174,0.7017755508422852,0.07738744467496872,-0.35983410477638245,0.0824652910232544,-0.516164243221283,-0.39203929901123047,0.02871468849480152,-0.16342377662658691,-0.3287411332130432,-0.5521352887153625,-0.035027019679546356,0.1283828765153885,-0.1309739649295807,-0.5703502893447876,0.160470113158226,-0.403632253408432,-0.27188393473625183,0.11247940361499786,-0.1287207156419754,0.0970403254032135,0.2724427878856659,-0.12040754407644272,-0.338223397731781,-0.4536556005477905,-0.04086614027619362,-0.05302724987268448,-0.12475474923849106,-0.192582905292511,0.8747761845588684,0.34147992730140686,-0.18566679954528809,0.6815459132194519,0.2874603271484375,-0.2723957300186