VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'severe, depending on the symptoms. Severe AUD is sometimes called alcoholism or alcohol dependence. AUD is a disease that causes: Craving - a strong need to drink Loss of control - not being able to stop drinking once you''ve started Negative emotional state - feeling anxious and irritable when you are not drinking What is binge drinking? Binge drinking is a type of alcohol misuse. It means drinking so much at once that your blood alcohol concentration (BAC) level is 0.08% or more. For a man, this usually happens after having 5 or more drinks within a few hours. For a woman, it is after about 4 or more drinks within a few hours. Not everyone who binge drinks has an AUD, but they are at higher risk for getting one. What are the dangers of too much alcohol? Too much alcohol is dangerous. Heavy drinking can increase the risk of certain cancers. It may lead to liver diseases, such as fatty liver disease and cirrhosis. It can also cause damage to the brain and other organs.', '{-0.011635824106633663,-0.15670081973075867,-1.0691771507263184,0.3264967203140259,0.4179674983024597,0.25719353556632996,-0.29486674070358276,0.33792269229888916,0.04691894352436066,0.011079768650233746,0.43394219875335693,-0.0962839275598526,-0.574569821357727,-0.16219677031040192,-0.5533785820007324,0.25331154465675354,0.05471211299300194,0.6603221893310547,0.15204377472400665,-0.49380892515182495,-0.23675164580345154,-0.6836076378822327,0.07900575548410416,-0.14291194081306458,-0.39553627371788025,-0.08730804175138474,-0.32574671506881714,-0.5399039387702942,-0.2350597083568573,0.02636418119072914,-0.6096972227096558,0.23763303458690643,-0.310038685798645,-0.13349120318889618,-0.0885840430855751,-0.2580796182155609,0.04180322214961052,0.4553680419921875,0.19392111897468567,-0.32609790563583374,-0.556689441204071,0.10749831795692444,0.6562305688858032,-0.06615000218153,0.03342806547880173,0.6150234341621399,0.076026752591133