VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'enjoyed just so you could drink? Gotten into dangerous situations while drinking or after drinking? Some examples are driving drunk and having unsafe sex. Kept drinking even though it was making you feel depressed or anxious? Or when it was adding to another health problem? Had to drink more and more to feel the effects of the alcohol? Had withdrawal symptoms when the alcohol was wearing off? They include trouble sleeping, shakiness, irritability, anxiety, depression, restlessness, nausea, and sweating. In severe cases, you could have a fever, seizures, or hallucinations. If you have any of these symptoms, your drinking may already be a cause for concern. The more symptoms you have, the more serious the problem is. What should I do if I think that I might have an alcohol use disorder (AUD)? If you think you might have an AUD, see your health care provider for an evaluation. Your provider can help make a treatment plan, prescribe medicines, and if needed, give you treatment referrals.', '{-0.08811375498771667,-0.34177738428115845,-0.8999610543251038,0.03862372413277626,0.16197413206100464,0.1954435557126999,-0.7149498462677002,0.4330916702747345,0.2176671028137207,-0.47073304653167725,0.581208348274231,0.18005365133285522,-0.09407845884561539,-0.18809913098812103,-0.3105054199695587,0.2666546404361725,-0.39152035117149353,0.5933350324630737,0.20430615544319153,-0.5123388171195984,-0.31490767002105713,-0.6244739890098572,-0.13864845037460327,-0.18121641874313354,-0.3012089431285858,-0.36410215497016907,-0.33008062839508057,-0.5728580951690674,0.16653598845005035,0.14298377931118011,-0.6629612445831299,0.46896612644195557,-0.2141677737236023,0.13556958734989166,0.33160150051116943,-0.5458934307098389,0.044582050293684006,0.24313393235206604,-0.19509877264499664,-0.5617523789405823,-0.4026460647583008,-0.28899386525154114,0.21952089667320251,-0.1648404449224472,-0.17403939366340637,0.252579987049102