VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'ted vaccines use a weakened form of the germ. Inactivated vaccines use a killed version of the germ. Subunit, recombinant, polysaccharide, and conjugate vaccines use only specific pieces of the germ, such as its protein, sugar, or casing. Toxoid vaccines use a toxin (harmful product) made by the germ. mRNA vaccines use messenger RNA, which gives your cells instructions for how to make a protein (or piece of a protein) of the germ. Viral vector vaccines use genetic material, which gives your cells instructions for making a protein of the germ. These vaccines also contain a different, harmless virus that helps get the genetic material into your cells. These vaccines may work in different ways, but they all spark an immune response. The immune response is the way your body defends itself against substances it sees as foreign or harmful. These substances include germs that can cause disease. What happens in an immune response?', '{-0.28343141078948975,0.34346285462379456,0.36648908257484436,-0.10232369601726532,0.05793450400233269,-0.012225640937685966,0.1569734364748001,0.6180942058563232,-0.46259602904319763,0.0854603722691536,0.20899036526679993,0.6812626719474792,0.24395069479942322,-0.8231194615364075,-0.5797309279441833,0.04697836562991142,-0.1788572520017624,0.19862523674964905,0.46889832615852356,-0.18550260365009308,0.19847992062568665,-0.20600707828998566,-1.053115725517273,-0.07001500576734543,-0.3909514546394348,0.2981039881706238,-0.46860271692276,-0.6396428942680359,0.4394983649253845,1.202426791191101,-1.0091975927352905,0.7343529462814331,0.32083967328071594,0.8726117014884949,-0.5343050956726074,-0.09076737612485886,0.2950843572616577,1.1724714040756226,-0.2994748651981354,-0.17714715003967285,0.14237827062606812,0.009158790111541748,0.2503117024898529,-0.15218812227249146,-0.851473867893219,-0.34255826473236084,0.277189701795578,-0.3105725944042206,0.4868220388889313,-0.48820090293