VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'harmful. These substances include germs that can cause disease. What happens in an immune response? There are different steps in the immune response: When a germ invades, your body sees it as foreign. Your immune system helps your body fight off the germ. Your immune system also remembers the germ. It will attack the germ if it ever invades again. This "memory" protects you against the disease that the germ causes. This type of protection is called immunity. What are immunization and vaccination? Immunization is the process of becoming protected against a disease. But it can also mean the same thing as vaccination, which is getting a vaccine to become protected against a disease. Why are vaccines important? Vaccines are important because they protect you against many diseases. These diseases can be very serious. So getting immunity from a vaccine is safer than getting immunity by being sick with the disease.', '{-0.26841580867767334,0.021687868982553482,0.2784493863582611,-0.6027902960777283,0.09547198563814163,0.2650575339794159,0.32414674758911133,0.5318960547447205,-0.258338063955307,0.2908497452735901,0.546511709690094,1.1816960573196411,0.027088051661849022,-0.6856883764266968,-1.003405213356018,0.1805058866739273,-0.16475601494312286,0.12622329592704773,0.06790266931056976,0.020566390827298164,0.3181300163269043,-0.5559414625167847,-0.8243440389633179,-0.11276504397392273,-0.7937812805175781,0.04212729260325432,0.006414104253053665,-0.7140625715255737,0.5701320767402649,1.2869518995285034,-0.6822748184204102,0.6626232266426086,0.35806769132614136,0.6817179322242737,-0.3276975452899933,0.35995906591415405,0.07594066113233566,1.0452585220336914,0.24933820962905884,-0.5511667132377625,0.46697384119033813,-0.37514159083366394,0.16946667432785034,-0.35086590051651,-0.9455728530883789,-0.7352453470230103,0.09402944147586823,-0.49949565529823303,0.22201891243457794,-0.18217536807060242,-0.1213418