VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 's. So getting immunity from a vaccine is safer than getting immunity by being sick with the disease. For a few vaccines, getting vaccinated can actually give you a better immune response than getting the disease would. But vaccines don''t just protect you. They also protect the people around you through community immunity. What is community immunity? Community immunity, or herd immunity, is the idea that vaccines can help keep communities healthy. Normally, germs can travel quickly through a community and make a lot of people sick. If enough people get sick, it can lead to an outbreak. But when enough people are vaccinated against a certain disease, it''s harder for that disease to spread to others. This type of protection means that the entire community is less likely to get the disease. Community immunity is especially important for people who can''t get certain vaccines. For example, they may not be able to get a vaccine because they have weakened immune systems.', '{-0.311656653881073,0.4191843867301941,0.5091742277145386,-0.669340193271637,-0.3826979398727417,0.1655537486076355,-0.20668070018291473,-0.03269795700907707,-0.0593077726662159,0.04168795421719551,0.5969818234443665,1.2376129627227783,-0.036592476069927216,-0.3968287408351898,-1.3670918941497803,0.24861396849155426,-0.43085575103759766,-0.0455218106508255,-0.05565487593412399,-0.10236316919326782,-0.03289201110601425,-0.41472187638282776,-0.59651780128479,-0.2598005533218384,-0.39673322439193726,-0.22468197345733643,-0.11274082958698273,-1.0026273727416992,0.6093035936355591,1.7308979034423828,-0.30911967158317566,0.5993500351905823,-0.10653895139694214,0.5757965445518494,-0.2778463661670685,0.321650892496109,-0.044736526906490326,0.48491641879081726,-0.5986475348472595,-0.6801905035972595,0.901328980922699,-0.24473483860492706,-0.002278146566823125,-0.598524272441864,-1.2595741748809814,-0.3853507339954376,0.20622874796390533,-0