VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Germs and Hygiene On this page Basics Summary Start Here Prevention and Risk Factors Learn More Specifics See, Play and Learn No links available Research Clinical Trials Journal Articles Resources Find an Expert For You Children Teenagers Women Summary What are germs? Germs are microorganisms. This means that they can be seen only through a microscope. They can be found everywhere - in the air, soil, and water. There are also germs on your skin and in your body. Many germs live in and on our bodies without causing harm. Some even help us to stay healthy. But some germs can make you sick. Infectious diseases are diseases that are caused by germs. The main types of germs are bacteria, viruses, fungi, and parasites. How do germs spread?', '{-0.1024935245513916,0.32533755898475647,0.38383060693740845,-0.21997852623462677,0.5601326823234558,0.6095126867294312,0.47406259179115295,-0.13999585807323456,-0.38705116510391235,-0.2711259126663208,0.0832701176404953,0.8625391125679016,-0.09408517926931381,0.41487830877304077,-0.9045408964157104,0.12582476437091827,-0.2038014680147171,-0.3506186008453369,-0.16046568751335144,-0.45532822608947754,-0.4586825966835022,0.15073446929454803,-0.6589258909225464,0.23152928054332733,0.017857689410448074,0.006881976965814829,-0.14406470954418182,-0.6706342697143555,0.1792745143175125,0.7905144095420837,-0.2533620297908783,0.36204567551612854,0.7220267057418823,0.631330132484436,0.11222080886363983,0.6902867555618286,-0.5295825004577637,1.3072150945663452,1.2915598154067993,-0.39615073800086975,-0.003446278627961874,-0.21626484394073486,-0.4016772210597992,0.21633180975914001,-1.0177562236785889,0.40745067596435547,0.3191038966178894,0.05907018855214119,0.1271241009235382,0.4011734127998352,-0.8176406621932983,-0.3359917998313904,-0.5216798782348633,-0.23003439605236053,0.2149699479341507,-0.031477730721235275,0.3315792381763458,0.1993837207555771,-0.1880045235157013,0.