VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'e and increase the chances for successful rehabilitation and recovery. What are the types of stroke? There are two types of stroke: Ischemic stroke is caused by a blood clot that blocks or plugs a blood vessel in the brain. This is the most common type; about 80% of strokes are ischemic. Hemorrhagic stroke is caused by a blood vessel that breaks and bleeds into the brain Another condition that''s similar to a stroke is a transient ischemic attack (TIA). It''s sometimes called a "mini-stroke." TIAs happen when the blood supply to the brain is blocked for a short time. The damage to the brain cells isn''t permanent, but if you have had a TIA, you are at a much higher risk of having a stroke. Who is at risk for a stroke? Certain factors can raise your risk of a stroke. The major risk factors include: High blood pressure. This is the primary risk factor for a stroke. Diabetes. Heart diseases. Atrial fibrillation and other heart diseases can cause blood clots that lead to stroke. Smoking.', '{0.15168796479701996,0.26677289605140686,0.22441762685775757,-0.30147838592529297,0.25496920943260193,0.39642399549484253,0.29501965641975403,-0.7489528656005859,-0.7753543853759766,-0.2477721869945526,0.048647426068782806,0.4898763597011566,-0.5260946154594421,-0.2553243041038513,0.1665409654378891,-0.1664234697818756,0.7637344598770142,-0.1556665152311325,-0.36648398637771606,0.012118101119995117,-0.570893406867981,-0.42675796151161194,-0.0601099394261837,-0.21056301891803741,0.09153957664966583,0.5663744807243347,-0.174782395362854,-0.21601642668247223,0.09255645424127579,-0.1745774894952774,-0.7799549102783203,0.157842218875885,-0.33833327889442444,0.5701150298118591,-0.28768348693847656,-0.24397462606430054,-0.061652787029743195,0.9147562980651855,0.42571336030960083,-0.3070296049118042,0.10939519107341766,0.2668478786945343,-0.13415363430976868,-0.23221798241138458,0.24953694641590118,-0.45848461985588074,-