VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'hy diet Having obesity What are the symptoms of stroke? The symptoms of stroke often happen quickly. They include: Sudden numbness or weakness of the face, arm, or leg (especially on one side of the body) Sudden confusion, trouble speaking, or understanding speech Sudden trouble seeing in one or both eyes Sudden difficulty walking, dizziness, loss of balance or coordination Sudden severe headache with no known cause If you think that you or someone else is having a stroke, call 911 right away. How are strokes diagnosed? To make a diagnosis, your health care provider will: Ask about your symptoms and medical history Do a physical exam, including a check of Your mental alertness Your coordination and balance Any numbness or weakness in your face, arms, and legs Any trouble speaking and seeing clearly Run some tests, which may include Diagnostic imaging of the brain, such as a CT scan or MRI Heart tests, which can help detect heart problems or blood clots that may have led to a stroke.', '{0.20837819576263428,-0.4282345771789551,0.4334510564804077,-0.7851242423057556,0.2191227525472641,0.23184692859649658,0.3882577121257782,-0.32466360926628113,-0.6485159993171692,-0.5853214263916016,0.20701873302459717,0.6006876826286316,-0.20193469524383545,-0.2763735353946686,-0.7032752633094788,-0.09977322071790695,0.43678101897239685,0.23065687716007233,-0.45626553893089294,-0.49672871828079224,-0.7765362858772278,-0.12296652793884277,-0.2666386067867279,-0.5671507120132446,0.013537321239709854,0.4565030038356781,0.10196654498577118,-0.6351606249809265,0.2741999626159668,-0.23057392239570618,-0.9446189999580383,-0.05253875255584717,-0.6014915108680725,0.5553940534591675,0.04848971217870712,-0.36778920888900757,-0.1174483671784401,0.7449764013290405,0.5504969954490662,-0.583333432674408,0.1536499708890915,0.48105478286743164,-0.48578959703445435,-0.030172042548656464,-0.3656671941280365,-0.43874645233154297,-0.