VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'MRI Heart tests, which can help detect heart problems or blood clots that may have led to a stroke. Possible tests include an electrocardiogram (EKG) and an echocardiography. What are the treatments for stroke? Treatments for stroke include medicines, surgery, and rehabilitation. Which treatments you get depend on the type of stroke and the stage of treatment. The different stages are: Acute treatment, to try to stop a stroke while it is happening Post-stroke rehabilitation, to overcome the disabilities caused by the stroke Prevention, to prevent a first stroke or, if you have already had one, prevent another stroke Acute treatments for ischemic stroke are usually medicines: You may get tPA, (tissue plasminogen activator), a medicine to dissolve the blood clot. You can only get this medicine within 4 hours of when your symptoms started. The sooner you can get it, the better your chance of recovery.', '{-0.08423158526420593,0.5093623399734497,0.590260922908783,-0.5919713973999023,-0.062190912663936615,0.5303583741188049,0.32828402519226074,-0.3285536766052246,-0.7438181638717651,-0.414385050535202,-0.0699491798877716,0.5297338962554932,-0.4708807170391083,-0.25155624747276306,0.05484381690621376,-0.2246062457561493,0.8081467747688293,-0.21939413249492645,-0.5926231741905212,0.4140041470527649,-0.5444958806037903,-0.5717468857765198,-0.4752819538116455,-0.1936149150133133,0.43396174907684326,0.724608838558197,-0.1717175990343094,0.09410349279642105,0.4832484722137451,0.24302659928798676,-0.713941216468811,0.4032283425331116,-0.35639873147010803,0.4489465355873108,-0.21723602712154388,-0.5365682244300842,-0.7744512557983398,0.5434567928314209,0.7907029986381531,-0.40339523553848267,0.11652136594057083,0.3842410147190094,-0.612124502658844,0.022738508880138397,0.31763118505477905,-0.6661363244056702,-0.6408976912498474,-0.03620939701795578,0.523803174495697,0.16125085949897766,-0.37480536103248596,-