VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'again. If an arteriovenous malformation (AVM) is the cause of a stroke, you may need an AVM repair. An AVM is a tangle of faulty arteries and veins that can rupture within the brain. An AVM repair may be done through Surgery Injecting a substance into the blood vessels of the AVM to block blood flow Radiation to shrink the blood vessels of the AVM Stroke rehabilitation can help you relearn skills you lost because of the damage. The goal is to help you become as independent as possible and to have the best possible quality of life. Prevention of another stroke is also important, since having a stroke increases the risk of getting another one. Prevention may include heart-healthy lifestyle changes and medicines. Can strokes be prevented?', '{-0.4279388189315796,0.06811529397964478,0.14124251902103424,-0.6730521321296692,0.4798927307128906,0.05368657410144806,0.13839669525623322,-0.9373213648796082,-0.8340691924095154,-0.31981995701789856,0.214135080575943,0.8750975728034973,-0.8116515278816223,-0.5860239863395691,-0.8950557708740234,-0.2513468563556671,-0.02028413861989975,-0.053865186870098114,-0.08875110000371933,0.15503893792629242,-0.8775314688682556,-0.32489845156669617,0.2732538878917694,0.14710994064807892,0.35453560948371887,0.8202117681503296,-0.7904744148254395,0.022586630657315254,0.33711445331573486,0.5346508026123047,-0.8001475930213928,0.6406421661376953,-0.5163887143135071,0.38981786370277405,-0.22406625747680664,-0.17583130300045013,-0.610495924949646,0.3015432357788086,0.9558606743812561,-0.42548444867134094,0.1748584359884262,-0.4979170262813568,-0.7261933088302612,0.08208168298006058,-0.03036111406981945,-0.28006771206855774,-0.7321085929870605,-0.3307373523712158,0.02727881260216236,0.47195354104042053,-0.15767015516757965,-0.499345600605011,-0.4191940128803253,0.3774290680885315,0.3231982886791229,0.19337108731269836,-0.20454798638820648,-0.7941015958786011,0.47162050008773804