VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Arthritis On this page Basics Summary Start Here Diagnosis and Tests Treatments and Therapies Learn More Living With Related Issues Specifics Genetics See, Play and Learn Test Your Knowledge Research Statistics and Research Clinical Trials Journal Articles Resources Find an Expert For You Patient Handouts Summary What is arthritis? If you feel pain and stiffness in your body or have trouble moving around, you might have arthritis. Any disorder that affects the joints is often called arthritis. Joints are places where two bones meet, such as your elbow or knee. Most types of arthritis can cause joint pain and inflammation (swelling). Over time, a swollen joint can become severely damaged. Some kinds of arthritis can also cause problems in your organs, such as your eyes or skin. Treatment will depend on the type of arthritis you have. What are the types of arthritis? Common types of arthritis include: Osteoarthritis is the most common type of arthritis.', '{-0.017656544223427773,-0.10828296095132828,0.4926266074180603,-0.5678119659423828,-0.17871540784835815,0.8770968317985535,0.2407224178314209,1.343196153640747,-0.7485965490341187,-1.010987401008606,0.09344086050987244,0.1614038348197937,0.7575762271881104,-0.3022087514400482,-0.43111884593963623,0.10367007553577423,0.2745794653892517,-0.06073182448744774,0.19661197066307068,0.35952267050743103,-0.4914463460445404,-0.3610215187072754,-0.2325698435306549,0.43451157212257385,0.6535034775733948,0.07174903154373169,-1.0891047716140747,-0.07543081045150757,0.44810783863067627,0.09357937425374985,-0.18487073481082916,0.49373695254325867,-0.019835418090224266,-0.007646304555237293,-0.03309871628880501,-0.15920761227607727,-0.2278800904750824,0.13666053116321564,-0.49365103244781494,-0.2529385983943939,0.441694051027298,0.3777022361755371,-0.39079970121383667,-0.3864792287349701,0.18226882815361023,1.0976637601852417,1.1214183568954468,0.171294048428535