VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'f arthritis? Common types of arthritis include: Osteoarthritis is the most common type of arthritis. It''s often related to aging or injury. Autoimmune arthritis happens when your body''s immune system attacks healthy cells in your body by mistake. Rheumatoid arthritis is the most common form of this type of arthritis. Juvenile arthritis is a type of arthritis that happens in children. Infectious arthritis is an infection that has spread from another part of your body to the joint. Reactive arthritis is one type. Psoriatic arthritis affects people with psoriasis (itchy or sore scaly red and white skin patches). Gout is a painful type of arthritis that happens when too much uric acid builds up in your body. It often starts in the big toe. Other joints can also be affected. Ankylosing spondylitis is a type of arthritis of the spine that can cause stiffness and make it difficult to move and bend. What are the symptoms of arthritis?', '{0.2151709944009781,0.26847541332244873,0.8189630508422852,-0.11704623699188232,-0.3214081823825836,0.5787017345428467,-0.34382709860801697,1.361197829246521,-0.7215105891227722,-0.9161613583564758,0.3127005696296692,0.576752781867981,0.5901443362236023,-0.2298806756734848,-0.2190735787153244,0.06480590999126434,0.30519914627075195,0.12876063585281372,0.33642640709877014,0.3901655673980713,-0.6584637761116028,-0.28014177083969116,0.09657981991767883,0.29328760504722595,0.5090011358261108,0.11362690478563309,-0.805694580078125,0.13744579255580902,0.641024649143219,0.2808266580104828,0.09586688876152039,0.5788092017173767,-0.39179983735084534,-0.10740722715854645,0.3126777112483978,-0.44243237376213074,-0.3010006546974182,0.058605846017599106,-1.0673398971557617,-0.41040611267089844,0.1380692571401596,-0.062170639634132385,-0.6691122651100159,-0.6102763414382935,0.11105586588382721,0.8159675598144531,0.861187756061554,-0.34745338559150696,-0.5095198750495911,0.015233101