VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'that can cause stiffness and make it difficult to move and bend. What are the symptoms of arthritis? Pain, redness, warmth, and joint inflammation are common arthritis symptoms. You may not be able to move your joint as well as it should. Other symptoms could include fever, weight loss, breathing difficulties, or a rash. Symptoms often get worse as you age. Some symptoms of arthritis may be signs of other illnesses. Who is more likely to get arthritis? A few things that might increase your chance of getting arthritis include: Family history. You may be more likely to get certain types of arthritis if a member of your family has the disorder. Age. The risk of getting many types of arthritis increases with age. Sex. Certain types of arthritis are more common in women, while other types are more common in men. Other factors that might increase your risk of getting arthritis include having a previous joint injury, obesity, or lupus. How is arthritis diagnosed?', '{0.20075926184654236,0.11020960658788681,0.24329106509685516,-0.45627206563949585,-0.384061723947525,0.6843989491462708,-0.2577161490917206,1.1661888360977173,-0.31061482429504395,-0.7163966298103333,0.18353506922721863,0.5930432677268982,0.6928380131721497,-0.31809499859809875,-0.19155529141426086,0.37666869163513184,0.027917394414544106,-0.2703743577003479,-0.09874618053436279,-0.23063801229000092,-0.3815096318721771,-0.6060317158699036,0.04389851912856102,0.4398060441017151,0.36522147059440613,0.03892061114311218,-0.6543125510215759,-0.37408313155174255,0.658403754234314,0.5408172011375427,-0.12340464442968369,0.32837000489234924,-0.00019717949908226728,-0.16640779376029968,0.24768880009651184,-0.019921204075217247,-0.2721661627292633,0.5013388395309448,-0.5401939153671265,-0.5904541611671448,0.20120489597320557,0.20607495307922363,-0.26379016041755676,-0.8714555501937866,0.031682055443525314,0.7640116214752197,0.8645675182342529,-0.3025